# Hyperparameter tuning (GridSearchCV)

params = { 'penalty': ['l1', 'l2', 'elasticnet', 'none'], 'C': [0.01, 0.1, 1, 10],
          'solver': ['liblinear', 'saga'], 'l1_ratio': [0, 0.5, 1]}

grid = GridSearchCV(estimator = LogisticRegression(random_state = 0, max_iter = 1000), param_grid = params,
                    cv = 5, scoring = 'accuracy', n_jobs = -1, verbose = 1)
grid.fit(x_train, y_train)
print("Best params: ", grid.best_params_)

best_model = grid.best_estimator_
best_pred = best_model.predict(x_test)

# evaluate the model after tuning

# accuracy score
best_acs = accuracy_score(y_test, best_pred)
print (f"The Best Accuracy score: {best_acs:.2f}")

# classification report
print(f"\n Classification report: {classification_report(y_test, best_pred)}")

# confusion matrix
best_cm = confusion_matrix(y_test, best_pred)

plt.figure(figsize = (10, 7))
sns.heatmap(best_cm, annot = True, fmt = 'd', cmap = 'rocket')
plt.title('Confusion Matrix')
plt.xlabel('Predicted')
plt.ylabel('Actual')
plt.show()

